import React from 'react'
import {Link} from 'react-router-dom'

export default function Path({path, index}) {
  
  
  let stringPath = "/path/" + path.slice(0,index + 1).join('/');
  let current = path.at(index);
  return(<div>
    <Link to={stringPath}>{current}</Link>
  </div>)
}
